import React from 'react';
import './button.css';

const Button = ({ onClick, type, width, height, text, fontSize }) => {

    const buttonStyle = {
        background: type === "confirm" ? '#0A8AE8' : type === "cancel" ? '#171616' : '#0A8AE8',
        width: width,
        height: height,
        fontSize: fontSize,
    };



  return (
    <div className='button' style={buttonStyle} onClick={onClick}>
        <p className='button-text' style={{fontSize: fontSize}}> {text} </p>
    </div>
  )
};

export default Button;
